import React, { useState, useEffect } from 'react';



function Aboutme() {
    const wpURL = 'http://alberto.codes/wp/wp-json/wp/v2/posts';
    const [data, setData] = useState([]);
    const getData = () => {
        fetch(wpURL)
            .then(function (response) {
                console.log(response)
                return response.json();
            })
            .then(function (data) {
                console.log(data);
                setData(data)
            });
    }
    useEffect(() => {
        getData()
    }, [])

    return (
        <div className="aboutme">
            <h1>{data.id[0]}</h1>
            <h1>{ }</h1>


        </div>
    )
}

export default Aboutme
